package com.qhc.system.entity;import java.io.Serializable;import java.util.Date;/** *  * Function: Data transfer object. <br>  * * @author walker */public class ProvinceMap		implements Serializable {	private static final long serialVersionUID = -6656309067408940768L;		/* 销售工具省code */	private String stProvince = null;	/* sap省code */	private String sapProvince = null;	public ProvinceMap(){	}	public String getStProvince() {		return this.stProvince;	}	public void setStProvince(String stProvince) {		this.stProvince = stProvince;	}	 	public String getSapProvince() {		return this.sapProvince;	}	public void setSapProvince(String sapProvince) {		this.sapProvince = sapProvince;	}	 	@Override	public int hashCode() {		final int prime = 31;		int result = 1;		result = prime * result + ((stProvince == null) ? 0 : stProvince.hashCode());		return result;	}	@Override	public boolean equals(Object obj) {		if (this == obj) {			return true;		}		if (obj == null) {			return false;		}		if (getClass() != obj.getClass()) {			return false;		}		final ProvinceMap other = (ProvinceMap) obj;		return (this.stProvince == null ? other.stProvince == null : this.stProvince.equals(other.stProvince));	}		public String toString() {	    final String tab = "  ";	    String str = "";	    str = "ProvinceMap ( "	        + "stProvince = " + this.stProvince + tab	        + "sapProvince = " + this.sapProvince + tab	        + " )";		    return str;	}}